import {useEffect, useState} from "react";

function Filter({ onFilterValue }){

    const [show,setHide]=useState('false')
    const [selectedValues, setSelectedValues] = useState([]);
    const [checkedValues, setCheckedValues] = useState([]);
    const [uniqueCheckedValues, setUniqueCheckedValues] = useState([]);

    const handleCheckboxChange = (e) => {

        const value = e.target.value;
        const isChecked = e.target.checked;

        console.log(" e.target.value", e.target.value)
        console.log("value", value)
        console.log("isChecked",isChecked)


        if (isChecked){
            setCheckedValues([...checkedValues, value]);
            console.log("checkedValues",checkedValues)
            console.log("selectedvslue",  setCheckedValues([...checkedValues, value]))
        } else {
            setCheckedValues(checkedValues.filter((item) => item !== value));
        }
        setSelectedValues(selectedValues.concat(checkedValues));
        onFilterValue(selectedValues);

    };

    const handleUniqueCheckBoxChange = (e) => {
        const value = e.target.value;
        if (e.target.checked) {
            if (!uniqueCheckedValues.includes(value)) {
                setUniqueCheckedValues((prev) => [...prev, value]);
            }
        } else {
            setUniqueCheckedValues((prev) => prev.filter((v) => v !== value));
        }
    };

    const handleSubmit = (e) => {
        e.preventDefault();
    };
    const showHide=()=>{
        setHide(!show)
    }


    return (
        <div>
            <div className="flex items-center justify-center flex-col " onSubmit={handleSubmit}>

                <button id="dropdownDefault" data-dropdown-toggle="dropdown" onClick={showHide}
                        className="text-black ml-12 inline-flex
                        items-center"
                        type="button">
                        Filtreler
                </button>

                <div id="dropdown"  hidden={show} className="w-56 p-3 ml-4 h-auto bg-dwhite focus:text-cpink">
                    <h6 className="mb-3 mt-2 text-sm font-medium text-cblack ">
                       Etkinlik Mekanı
                    </h6>
                    <ul className="space-y-2 text-sm" aria-labelledby="dropdownDefault">
                        <li className="flex items-center z-40">
                            <input
                                type="checkbox"
                                value="Maximum UNIQ Hall"
                                checked={checkedValues.includes('Maximum UNIQ Hall')}
                                onChange={handleCheckboxChange}

                                className="w-4 h-4 text-cblack"/>
                            <label htmlFor=""
                                   className="ml-2 text-xs font-medium text-cblack">
                                Maximum Uniq Hall
                            </label>
                        </li>
                        <li className="flex items-center z-40">
                            <input  type="checkbox"

                                    value="Maximum UNIQ Box"
                                    checked={checkedValues.includes('Maximum UNIQ Box')}
                                    onChange={handleCheckboxChange}
                                    className="w-4 h-4 text-cblack"/>
                            <label htmlFor=""
                                   className="ml-2 text-xs font-medium text-cblack">
                                Maximum Uniq Box
                            </label>
                        </li>
                        <li className="flex items-center">
                            <input type="checkbox"

                                   value="Maximum UNIQ Lounge"
                                   checked={checkedValues.includes('Maximum UNIQ Lounge')}
                                   onChange={handleCheckboxChange}
                                    className="w-4 h-4 text-cblack"/>
                            <label htmlFor=""
                                   className="ml-2 text-xs font-medium text-cblack">
                                Maximum Uniq Lounge
                            </label>
                        </li>
                        <li className="flex items-center">
                            <input  type="checkbox"

                                    value="Maximum UNIQ Açıkhava"
                                    checked={checkedValues.includes('Maximum UNIQ Açıkhava')}
                                    onChange={handleCheckboxChange}
                                    className="w-4 h-4 text-cblack"/>
                            <label htmlFor=""
                                   className="ml-2 text-xs font-medium text-cblack">
                                Maximum Uniq Açıkhava
                            </label>
                        </li>
                        <li className="flex items-center">
                            <input type="checkbox"

                                   value="Bahçe Fuaye"
                                   checked={checkedValues.includes('Bahçe Fuaye')}
                                   onChange={handleCheckboxChange}
                                    className="w-4 h-4 text-cblack"/>
                            <label htmlFor=""
                                   className="ml-2 text-xs font-medium text-cblack">
                                Bahçe Fuaye
                            </label>
                        </li>

                    </ul>

                    <h6 className="mb-3 mt-2 text-sm font-medium text-cblack ">
                        Etkinlik Tarihi
                    </h6>
                    <ul className="space-y-2 text-sm" aria-labelledby="dropdownDefault">
                        <li className="flex items-center">
                            <input  type="checkbox"
                                    className="w-4 h-4 text-cblack bg-cpink "/>
                            <label htmlFor=""
                                   className="ml-2 text-xs font-medium text-cblack">
                                Güncel Etkinlikler
                            </label>
                        </li>
                        <li className="flex items-center">
                            <input  type="checkbox"
                                    className="w-4 h-4 text-cblack"/>
                            <label htmlFor=""
                                   className="ml-2 text-xs font-medium text-cblack">
                                Geçmiş Etkinlikler
                            </label>
                        </li>

                    </ul>
                </div>



            </div>

        </div>
    )
}
export default Filter
